import React from 'react';
import Sidebar from './Sidebar';
import '../css/app.css';
import Mainpage from './Mainpage';

function App() {
  return (
    <div className="main">
      <div className="plan">
        <Sidebar></Sidebar>
        <Mainpage></Mainpage>
      </div>
    </div>
  );
}

export default App;
